import "./List.scss";

function List() {
  
  return (
    <div>
      <div className="list">
        <span className="listTitle">Continoues to watch</span>
        <div className="wrapper">
          <div className="containe">
            {movies.map((movie) => (
              <img
                className="row_poster"
                src={`${baseUrl}${movie.poster_path}`}
                alt={movie.name}
                key={movie.id}
              />
            ))}
          </div>
        </div>
      </div>
    </div>
  );
}
export default List;
